event:
Christianisme voire astrologie d'origine babylonienne ci-après :
Nativité ci-avant de Marie mère de Jésus[12] ( / Natividad de la santa Virgén (...) en hispanophonies), juste neuf mois jour pour jour après son Immaculée Conception fixée au 8 décembre, en ce lendemain de Santa Regina et avant-après la Nativité fixée aux 25 décembre pour son fils Jésus ;
lectures de Sg. 8, 2-4 ; Is. 11, 1(-9) ; 11, 10 + 16, 5 ; Héb. 8, 7 – 9, 10 et Lc 11, 27-32 ; avec pour mot commun à Sg. (8, 8), Is. (11, 10) et Lc : signes (lectionnaire de Jérusalem).

Christianisme :
fête du Saint Nom de Marie dans la liturgie catholique ;
mémoire de Notre-Dame de Lipa.

Christianisme :
fête de la vraie Sainte Croix ou exaltation de la Sainte-Croix, une des plus anciennes solennités liturgiques de l'Église chrétienne puisqu'elle se célébrait déjà au IVe siècle à Jérusalem (et voir reliques saintes de la Sainte Chapelle et la cathédrale Notre-Dame à Paris) ;
jadis début de la semaine des Quatre-Temps d'automne en chrétienté, entre 14 septembre et début de l'automne à date mobile d'équinoxe.
